import React from "react";
import '../style.css';

class SignUp extends React.Component{
  render(){
    return (
      <header id = "bg2">
        <img src="http://razzlers.me:8080/Razzlers_files/Razzlers-Logo.png" height = "80"/>
        <button
          className="btn btn-primary"
          type="button">
            Sign Up
        </button>
      </header>
    )
  }
}
export default Header
